VALUES ('expert@test.com', 6, 'Strategy 5', 'This strategy is adapted for ETH-USDT pair on Binance Spot. If you would like to use it with other pairs or other exchanges, I suggest running several back-tests before starting live session.
Maya is a swing strategy efficient on long term (at least 3 months). You can run full USDT, full ETH, 50/50 or whatever you want, depending on the market evolution.
MACD, EMA, VOLUME indicators are used to detect bullish market for buy entries. Some ICHIMOKU conditions are used to switch from a block to another. Take Profits is triggered in different ways: Trailing Sell to secure profits or indicators detection. Stop Loss are executed on indicators detection, not on % of price dump, so it could be different depending on the market evolution.
During Bullish market or strong dump, the strategy is switching into the Accumulation Mode, small buy orders are placed to be sold on price pump. A Telegram group is available for questions and suggestions @mayabotstrategy do not hesitate to join us.
