VALUES ('expert@test.com', 5, 'Strategy 6', 'This strategy does not trade every day, on the contrary, it seeks to make the most relevant trades possible and therefore as often as possible. Like any bot this one sometimes makes mistakes. You can lose money. This strategy can lead to very large drawdowns over long periods of time. The strategy may not trade for long periods (max 15 days) -> This is normal. When you launch the strategy it can wait between 1 day and up to 10 days to start. It does not seek to make the record of the number of trades, on the contrary it seeks to be efficient.
LIFE IS TOO SHORT is a bot developed specifically for the BTC / USDT pair on Binance. I advise you to always start in Full USDT (Minimum 300 USDT) This bot has been designed to trade on a minimum of 3 confirmations. It has its SETUP on confirmations and will not deviate from it.
The bot works for both Bullish and Bearish markets. On Bull Market, he will try to exit as late as possible and can hold a trade open for several days. On the bear market, it will invest by step by accumulating more and more BTC. Average frequency of trading: 1 day out of 3. But the strategy may not start a trade over longer periods (see backtests)
If you are looking for a strategy that trades daily, this Bot is not for you. The accumulation mode can lead to significant drowdown over short periods of time. This Bot works on confirmation, it will not be able to buy every time at the lowest, nor sell at the highest, but will constantly seek confirmations for its SETUP in order to maximize the gains in the medium / long term.
I invite you to backtest the Bot in order to better understand its philosophy.
Thank you again for choosing this strategy.', 'BTC', 'BNB', 13.95, '06', '2020-09-17 16:12:28', '2020-05-07 15:19:41')
